import React from 'react';
import '../Styles/Navbar.css';
import { Link } from 'react-router-dom';


const Navbar= () => {
    return (
            <nav>
                <ul>
                    <Link to="/">Home</Link>
                    <li><a href="#causes">Causes</a></li>
                    <Link to="/about">About</Link>
                    <Link to="/faq">Faq</Link>
                </ul>
            </nav>
    );
};

export default Navbar;
